import React, { Component } from "react";
import "./App.css";
import dotenv from "dotenv";
dotenv.config();
const ISTHIS = process.env.REACT_APP_ISTHIS;
console.log(ISTHIS);

class Subject extends Component {
  render() {
    return (
      <header>
        <h1>{ISTHIS}</h1>
        {this.props.sub}
      </header>
    );
  }
}

class Toc extends Component {
  render() {
    return (
      <nav>
        <ul>
          <li>
            <a href="1.html">HTML</a>
          </li>
          <li>
            <a href="2.html">CSS</a>
          </li>
          <li>
            <a href="3.html">JavaScript</a>
          </li>
        </ul>
      </nav>
    );
  }
}

class Content extends Component {
  render() {
    return (
      <article>
        <h2>{this.props.title}</h2>
        {this.props.desc}
      </article>
    );
  }
}

class App extends Component {
  render() {
    return (
      <div className="App">
        <Subject title={"Web"} sub={"world wide we!"} />
        <Subject title="isThis" sub="work?" />
        <Toc />
        <Content title="HTML" desc="HTML is HyperText Markup Languagee" />
      </div>
    );
  }
}
export default App;
